import { Box, Typography } from '@mui/material'
import React from 'react'

function view() {
  return (
    <Box sx={{
        position:'relative',
        width:'100%',
        height:'30rem',
        display:'flex',
        top:'7rem',
        bgcolor:'red',
        mb:'1rem'
    }}>
        <Typography>view product</Typography>
    </Box>
  )
}

export default view
